            <div className="type fle">

            </div>
            {
                data.map((elem) =>{
                    const {img,name,status} = elem
                    return(
                        <div className="container" style={{display:"flex", flexDirection:"row"}}>
                            <img src={img} alt="img" style={{width:"100px"}} / >
                            <div className="content">

                            </div>
                        </div>
                    )
                })
            }
        </>
    )
}


export default FoodItem
